// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Crowdsale.sol";
contract createCS{
    ERC20 tkn;
    uint totalid;
    struct h{
        uint a;
    }
    struct CS{
        address creater; 
        address wallet;
        address csAdd;
        uint rate;
    }

    mapping (uint=>CS) public allcs;

    function createCs(uint rate,ERC20 _tkn,address wallet) public returns(uint){
        uint id=totalid++; 
        CS storage yes=allcs[id];
        yes.creater=msg.sender;
        yes.csAdd=address(new Crowdsale(rate,wallet,_tkn));
        yes.rate=100;
        return id;
    }
    function seeUrCs(uint _id) public returns(CS memory){
        require(allcs[_id].creater==msg.sender,"not creater");
        return allcs[_id];
    }
}
